import React from 'react'
import * as IoIcons from 'react-icons/io';

export const SidebarData = [
    {
        title: 'Home',
        path: '/',
        cName: 'nav-text',
    },
    {
        title: 'Tinder Case Study',
        path: '/tinder-case-study',
        cName: 'nav-text',
        name: "Tinder Case Study", 
        imgSrc: require('../images/Tinder.png')
    },
    {
        title: 'Panasonic Internship',
        path: '/panasonic-internship',
        cName: 'nav-text',
        name:"Panasonic Internship", 
        imgSrc: require('../images/Panasonic.png')
    },
    {
        title: 'CoreLogic Internship',
        path: '/corelogic-internship',
        cName: 'nav-text',
        name: "CoreLogic Internship", 
        imgSrc: require('../images/CoreLogic.png')
    },
    {
        title: 'About Me',
        path: '/about-me',
        cName: 'nav-text',
        name: "About Me", 
        imgSrc: require('../images/me.png')
    },
    {
        title: 'Side Projects',
        path: '/side-projects',
        cName: 'nav-text',
        name: "Side Projects", 
        imgSrc: require('../images/side.png')
    },
]
